} Sooooooooo this is pretty problematic, we can spawn entities with other generators, despawn them, and then spawn a dead entity. Looking back over our code with this in mind we can also see that we can ask if an entity that hasnt been spawned yet is alive and it would say yes. So how should we handle this? We can use next_id to check if the entity passed in has been spawned yet. # #[derive(Debug, Copy, Clone, Eq, PartialEq, Hash)]
#pub struct Entity(u64);
#
#use std::collections::HashSet;
#struct HashsetMethod(HashSet<Entity>);
