impl HashsetMethod { fn despawn(&mut self, next_id: u64, entity: Entity) { // New if self.is_alive(next_id, entity) == false { return; } self.0.insert(entity); } fn is_alive(&self, next_id: u64, entity: Entity) -> bool { // New if entity.0 >= next_id { panic!("Attempted to use an entity from a different EntityGenerator"); } self.0.contains(&entity) == false }
} fn main() { let mut statuses = HashsetMethod(HashSet::new()); let e1_1 = { // Spawn an entity from one generator # Entity(0) // haha ur so sneaky hi }; statuses.despawn(0, e1_1); let e1_2 = { // Spawn the same entity from a second generator # Entity(0) // haha ur so sneaky hi }; statuses.is_alive(1, e1_2); assert!(false); // We should panic before getting here :)
} You'll notice that in is_alive we panic if the entity hasn't been spawned yet since it's definitely a bug on the user's side to mixup entities like this. You could also return false; here if you're opposed to panic'ing :)

